import React from "react";

const Search = () => {
  return (
    <div>
      <div className="form-floating mt-3 mb-3">
        <input type="text" className="form-control" id="floatingInput" />
        <label for="floatingInput">Search</label>
      </div>
    </div>
  );
};

export default Search;
